import React from 'react';
import Logo from "../assets/pizzaLogo.png"
import { Link } from 'react-router-dom';

function Navbar () {
  return (
    <div className='navbar'>
        <div className='leftSide'>
            <img src={Logo}/>
        </div>
        <div className='rightSide'>

        </div>
      
    </div>
  );
}

export default Navbar;
